    {
        var value = await this.Grid.GetSelectedRecords();
        navigationManager.NavigateTo($"UserProfile/{value.First().UserName}");
    }

    private void Navigate(AppUser appUsr)
    {
        navigationManager.NavigateTo($"UserProfile/{appUsr.UserName}");
    }

