    {
        var passwordHasher = new PasswordHasher<ApplicationUser>();
        // add new user
        ApplicationUser newUser;
        string hashedPwd;
        int newPrUserId;
        newUser = await _UserManager.FindByNameAsync(NewUserName.Trim());
